import axios from 'axios';

// const BUS_API_URL="http://localhost:8090/getallbuses";
class BusService{

    getBuses(){
        return axios.get("http://localhost:8090/getallbuses");
    }
    deleteBus(id) {
        return axios.delete(`http://localhost:8090/${id}`);
      }
}

export default new BusService()
